    }*/

    return (
        <div className="PopSlider">
            <Slider
                defaultValue={Math.log2(sliderValue)}
                getAriaValueText={valuetext}
                aria-labelledby="discrete-slider"
                valueLabelDisplay="auto"
                step={1}
                marks
                min={Math.log2(sliderMin)}
                max={Math.log2(sliderMax)}
            />

            <label for="population-size">GA Population Size</label>
            <input type="range" min={Math.log2(sliderMin)} max={Math.log2(sliderMax)} value={Math.log2(sliderValue)} class="slider" id="population-slider" />
            <label for="population-size-value">{ sliderValue }</label>
        </div>
    );
};

export default PopSlider;
